import React from 'react';
import logo from './logo.svg';
import './App.css';

import data from '/Users/mckennastaley/Documents/School/Winter 2023/IS 413/Mission12_mnnorton/frontend/src/CollegeBasketballTeams.json';

interface ITeamProps {
  school: string;
  name: string;
  city: string;
  state: string;
}

const teamJSON = data;

function Welcome(){
  return(<h1>Welcome! View NCAA March Madness Information here.</h1>);
}

class Team extends React.Component<ITeamProps> {
  render() {

    const oneTeam = this.props;

    return (
      <div>
        <h4>{oneTeam.school}</h4>
        <h4>{oneTeam.name}</h4>
        <h4>{oneTeam.city}, {oneTeam.state}</h4>
      </div>
    );
  }
}

function TeamList() {
  return (
    <div>
      {teamJSON.teams.map(oneTeam => <Team
        key={oneTeam.tid}
        school={oneTeam.school}
        name={oneTeam.name}
        city={oneTeam.city}
        state={oneTeam.state}
      />)}
    </div>
  );
}


function App() {
  return(
    <div>
      <Welcome/>
      <TeamList/>
    </div>
  )
}

export default App;
